import React from 'react';
import './Product.css';
function Product() {
    return (
        <div className="product">
            <div className="product__info">
                <p>Corsair CF-9010011 WW T1 Race Gaming Chair Racing Design, Black/Black</p>
                <p className="product__price">
                    <small>₹</small>
                    <strong>29,570.00</strong>
                </p>
                <div className="product__rating">
                    <p>⭐</p>
                </div>
                <div>
                <img src="https://m.media-amazon.com/images/I/7101SstjG9L._SL1500_.jpg" alt=""  />
                <button>Add to cart</button>
                </div>
            </div>
        </div>
    );
}

export default Product;
